import{_ as e,a as r,b as a,c as t,d as o}from"./chunks/hovergames_colored_small.DPlTFxWq.js";import{_ as n,c as l,o as i,ab as s}from"./chunks/framework.CUflZczI.js";const D=JSON.parse('{"title":"NXP RDDRONE-FMUK66 FMU","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/nxp_rddrone_fmuk66.md","filePath":"ko/flight_controller/nxp_rddrone_fmuk66.md"}'),p={name:"ko/flight_controller/nxp_rddrone_fmuk66.md"},h=s('<h1 id="nxp-rddrone-fmuk66-fmu" tabindex="-1">NXP RDDRONE-FMUK66 FMU <a class="header-anchor" href="#nxp-rddrone-fmuk66-fmu" aria-label="Permalink to &quot;NXP RDDRONE-FMUK66 FMU&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4에서는 이 제품을 제조하지 않습니다. 하드웨어 지원과 호환 문제는 <a href="https://www.nxp.com/" target="_blank" rel="noreferrer">제조사</a>에 문의하십시오.</p></div><p>RDDRONE-FMUK66 FMU는 2 자동차 이더넷 100BASET1 및 보안 요소 A71CH (RevC) 또는 SE050 (RevD)을 추가하여 Pixhawk FMUv4 사양을 준수하는 NXP Semiconductor 구성 요소를 사용하는 참조 설계입니다. NXP는 이 설계를 복제, 변경 또는 재활용 할 수 있도록 회로도, 거버, BOM 및 소스 파일을 제공합니다.</p><p><a href="https://www.hovergames.com/" target="_blank" rel="noreferrer">HoverGames</a>와 함께 사용하기 위한 공식 FMU입니다.</p><p><img src="'+e+'" alt="RDDRONE-FMUK66 FMU 대표 이미지 1"></p><p><img src="'+r+'" alt="RDDRONE-FMUK66 FMU 대표 이미지 2"></p><p>NXP FMU와 포함된 주변 장치는 FCC/CE/RoHs/REACH 지침을 준수합니다.</p><p>:::note 이 비행 컨트롤러는 <a href="./../flight_controller/autopilot_manufacturer_supported.html">제조업체에서 지원</a>합니다. :::</p><h2 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h2><ul><li><strong>메인 FMU 프로세서:</strong><ul><li>180MHz Cortex-M4F MCU, 2MB 플래시, 256KB SRAM, 듀얼 USB (FS + HS), 이더넷, 144-LQFP에서 실행되는 Kinetis K66 MK66FN2MOVLQ18 마이크로 컨트롤러.</li></ul></li><li><strong>내장 센서:</strong><ul><li>가속/자이로: BMI088/ICM42688 (RevD) ...</li><li>가속/자력계: FXOS8700CQ</li><li>자이로: FXAS21002CQ</li><li>자력계: BMM150</li><li>기압계: ML3115A2</li><li>기압계: BMP280</li></ul></li><li><strong>GPS:</strong><ul><li>u-blox Neo-M8N GPS/GLONASS 수신기; 통합 자력계 IST8310</li></ul></li></ul><p>이 FMU는 키트로만 제공되며 <a href="https://www.segger.com/products/debug-probes/j-link/models/j-link-edu-mini/" target="_blank" rel="noreferrer">Segger Jlink EDU 미니 디버거</a>, DCD-LZ 디버거 어댑터, USB-TTL-3V3 콘솔 케이블, HolyBro GPS 모듈, 배터리 전원 모듈, SDCard 및 케이스, 나사와 스티커를 포함하고 있습니다. 텔레메트리 라디오(<a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a> 및 <a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a>)는 해당 국가에서 사용되는 ISM 대역 주파수와 일치하는 제품을 구매하여야 합니다.</p><p><img src="'+a+'" alt="RDDRONE-FMUK66 FMU 키트"></p><p>전원 모듈, GPS, Jlink 또는 USB-TTL-3V3 콘솔 케이블 또는 SDCard를 포함하지 않는 &quot;Lite&quot; 버전 RDDRONE-FMUK66L도 사용할 수 있습니다. <a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">아래로 스크롤하여 FMUK66 구매 페이지의 구매 섹션에서 FMUK66L을 확인하세요.</a></p><p>추가적인 정보는 <a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66" target="_blank" rel="noreferrer">기술 데이트시트</a>를 참고하십시오. </p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p><strong>RDDRONE-FMUK66</strong> 참조 설계 키트는 NXP에서 직접 구매하거나 NXP의 공인 전세계 <a href="https://www.nxp.com/support/sample-and-buy/distributor-network:DISTRIBUTORS" target="_blank" rel="noreferrer">전자 유통 업체</a> 네트워크에서 구매할 수 있습니다.</p><ul><li><a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">구매 링크</a> (www.nxp.com)</li><li>원격 측정 라디오는 주파수 대역에 따라 별도로 구매하여야 합니다. <ul><li><a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a></li><li><a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a></li></ul></li></ul><div class="info custom-block"><p class="custom-block-title"><em>RDDRONE-FMUK66</em> FMU is also included in the complete HoverGames drone kit: <a href="https://www.nxp.com/applications/solutions/industrial/aerospace-and-mobile-robotics/uavs-drones-and-rovers/nxp-hovergames-drone-kit-including-rddrone-fmuk66-and-peripherals:KIT-HGDRONEK66#buy" target="_blank" rel="noreferrer">KIT-HGDRONEK66</a></p></div><h2 id="조립-및-설정" tabindex="-1">조립 및 설정 <a class="header-anchor" href="#조립-및-설정" aria-label="Permalink to &quot;조립 및 설정&quot;">​</a></h2><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">https://nxp.gitbook.io/hovergames</a></p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">대부분의 사용자들은 펌웨어를 빌드할 필요는 없습니다. It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p><p>:::</p><p>이 대상에 대한 <a href="./../dev_setup/building_px4.html">PX4 빌드</a> 방법 :</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make nxp_fmuk66-v3_default</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p><a href="./../debug/system_console.html">PX4 시스템 콘솔</a>과 <a href="./../debug/swd_debug.html">SWD 인터페이스</a>는 <a href="https://nxp.gitbook.io/hovergames/rddrone-fmuk66/connectors/debug-interface-dcd-lz" target="_blank" rel="noreferrer">DEC-LZ FMU 디버그</a> 포트에서 실행됩니다.</p><p>NXP&#39;s DCD-LZ is a 7 pin JST-GH connector and adds the nRST/MCU_RESET pin to the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk 6-Pin standard debug port</a>.</p><p>DCD-LZ 브레이크아웃 어댑터를 사용하면 표준 10핀 JTAG/SWD 인터페이스(예 : Segger Jlink 사용) 및 표준 5핀 FTDI USB-TTL-3V3 유형 케이블을 사용할 수 있습니다.</p><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트. 지원되는 운송체의 설정은 <a href="./../airframes/airframe_reference.html">기체 정의서</a>를 참고하십시오.</p><p><img src="'+t+'" alt="HoverGames 드론 키트"></p><div class="tip custom-block"><p class="custom-block-title">NXP</p><p><a href="https://www.nxp.com/kit-hgdronek66" target="_blank" rel="noreferrer">HoverGames Drone Kit</a> (위 그림 참조)는 쿼드콥터 제작에 필요한 것들이 포함된 드론 개발 키트입니다. 3S/4S LiPo 배터리만 추가로 구매하시면 됩니다.</p></div><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">HoverGames 온라인 문서</a> PX4 사용자 및 프로그래밍 가이드, 특정 어셈블리, 구성, 디버깅, 프로그래밍 지침.</p></li><li><p>3DModels supporting HoverGames and RDDRONE-FMUK66 can be found on <em>Thingiverse</em> at these search links: <a href="https://www.thingiverse.com/search?q=fmuk66&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">fmuk66</a>, <a href="https://www.thingiverse.com/search?q=hovergames&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">hovergames</a>.</p></li></ul><p><img src="'+o+'" alt="HoverGamesDronelogo"></p></div>',22),d=[h];function c(m,u,f,g,b,_){return i(),l("div",null,d)}const M=n(p,[["render",c]]);export{D as __pageData,M as default};
